import {
  NEW_ORDER_INSTANT_QUOTE,
  NEW_ORDER_FORM_VEHICLE_DETAILS,
} from "../constants/orderFormConstants";

export const instantQuoteForm = (vehicleMake, vehicleModel, vehichleYear) => {
    return {
      type: NEW_ORDER_FORM_VEHICLE_DETAILS,
      payload: {
        vehicleMake,
        vehicleModel,
        vehichleYear,
      },
    };
  };
  

export const vehicleDetailsForm = (vehicleMake, vehicleModel, vehichleYear) => {
  return {
    type: NEW_ORDER_FORM_VEHICLE_DETAILS,
    payload: {
      vehicleMake,
      vehicleModel,
      vehichleYear,
    },
  };
};
